import React from 'react';
import axios from 'axios';
import cookie from 'js-cookie';
import '../styles/components/_Navbar.scss';


const Logout = () => {

    const removeCookie = (key) => {
        if (window != "undefined") {
            cookie.remove(key, { expires: 1 });
        }
    };

    const dropdownToggles = document.querySelectorAll('.dropdown-toggle');
        dropdownToggles.forEach(toggle => {
        toggle.addEventListener('click', () => {
        toggle.nextElementSibling.classList.toggle('show');
        });
    });

    const logout = async () => {
        await axios({
            method:'get',
            url: `http://localhost:5000/api/user/logout`,
            withCredentials: true
        })
        .then(() => removeCookie('access-token'))
        .catch((err) => console.log(err))

        window.location = "/";
    }

    return (
        // <li className="nav-logo-login" onClick={logout}>
        //     <p>Logout</p>
        //     {/* <img src="../img/contour_blanc_off.svg" height="26px" alt="logout"/> */}
        // </li>
        <ul class="dropdown-menu" >
            <li class="dropdown-item" onClick={logout}><a href="#">Logout</a></li>
            <li class="dropdown-item"><a href="#">Option 2</a></li>
            <li class="dropdown-item"><a href="#">Option 3</a></li>
        </ul>
    );
};

export default Logout;
